import sys
import googlemaps
from datetime import datetime
import html2text

h = html2text.HTML2Text()

class dirctions:
    def __init__(self):
        print("dirc imported and should work")
        self.this='this is a thing in init'
        self.directions_to()

    # comment
    def distance(self,origin,destination):
        gmaps = googlemaps.Client( key='AIzaSyBxmKAcGrKpJCEf-mWsZDCJ4ttdqKnxhkE' )

        now = datetime.now()
        directions_result = gmaps.directions( origin,
                                              destination,
                                              mode="driving",

                                              departure_time=now )

        distance = directions_result[0].get( 'legs', "" )[0].get( 'distance', "" ).get( 'text', "" )
        return distance




    def directions_to(self,origin,destination):
        gmaps = googlemaps.Client( key='AIzaSyBxmKAcGrKpJCEf-mWsZDCJ4ttdqKnxhkE' )

        now = datetime.now()
        directions_result = gmaps.directions( origin,
                                              destination,
                                              mode="driving",

                                              departure_time=now )

        distance =  directions_result[0].get('legs',"")[0].get('distance',"").get('text',"")

        print(distance)

        steps = 0
        leg = 1
        file = open('directions.txt','w')
        file.write('')


        for x in directions_result[0].get('legs','')[0].get('steps',""):


            step = directions_result[0].get('legs','')[0].get('steps',"")[steps].get('html_instructions',"")
            steps = steps + 1
            print(steps)
            step = (h.handle(step))

            print(step)
            file = open('directions.txt','a+')
            file.write(str(steps)+'. '+ step)















